import React, { useState } from 'react';
import insert from './buttons';

function BST()
{
    const [showinsert, setShowinsert] = useState(false);
    const [showdelete, setShowdelete] = useState(false);
    const [showinorder, setShowinorder] = useState(false);
  //const [showAVL, setShowAVL] = useState(false);

  const handleinsertclick = () => {
    setShowinsert(true);
    setShowdelete(false);
    setShowinorder(false);
  };

  const handledeleteclick = () => {
    setShowinsert(false);
    setShowdelete(true);
    setShowinorder(false);
  };

  const handleinorderclick = () => {
    setShowinsert(false);
    setShowdelete(false);
    setShowinorder(true);
  };

    return(
        <div>
        <h1>BST TREE</h1>
        <button onClick={handleinsertclick}>INSERT</button>
        <button onClick={handledeleteclick}>DELETE</button>
        <button onClick={handleinorderclick}>INORDER</button>
        <button>PREORDER</button>
        <button>POSTORDER</button>

        {showinsert && <insert />}
        {showdelete && <del />}
        {showinorder && <inorder />}
        </div>
    )

}
export default BST;
